import React, { useState, useEffect } from "react";

function EnrollDecide(props) {
  return (
    <div>
      {props.enrollment.map((enroll) => {
        if (enroll.status == "pending") {
            return props.user.map(usr =>{
                if(usr.id === enroll.userId){

                    return (
                        <div >
                        <p>{usr.email}</p>
                        <p>{enroll.status}</p>
                        <p>{enroll.id}</p>
                        <p>{enroll.trialId}</p>
                      </div>
                    );

                }
            })

        }
      })}
    </div>
  );
}

export default EnrollDecide;
